import React, { Component } from 'react'
import './Dashboard.css'
export default class dasshboard extends Component {
    render() {
        return (
            <div>
    <h1>Socket.IO chat</h1>
   
    <ul id="messages"></ul>
    <form action="">
      <input id="m" autocomplete="off" /><button>Send</button>
    </form>
            </div>
        )
    }
}
